 var w = $('#'+id);


/* SETUP */
var rel_name;
var relation = datum;

if (!(datum instanceof AQ.Rowset)) {
    datum = datum.rows()
    .then(function(rows) {
        rel_name = rows.relation.schema.name + '.' + rows.relation.name;
        w.find('.title').text(rel_name);
        return rows;
    });
} else {
    rel_name = datum.relation.schema.name + '.' + datum.relation.name;
    relation = rows.relation;
    w.find('.title').text(rel_name);
}

context = typeof context != 'undefined' ? context : {};


// Use columns from meta_data if included
if (!datum.columns) {
    var columns = endpoint.schema('meta').table('column').rows({
        where: {
            name: 'relation_id',
            op: '=',
            value: relation.id
        },
        include: ['id', 'name']
    });
}
else {
    var columns = Promise.resolve(datum.columns);

}
columns = columns.then(function(col) {
    return col.map(function(c) {
        return typeof c.get != 'undefined' ? c.get('name') : c.name;
    });
});

// Sync the column names in the table heading
widget.sync(columns, w.find('.columns'), function(column) {
    return '<th>' + column + '</th>';
});

if (!datum.length) {
    w.find('.columns').hide();
}

// Sync the rows in this table
widget.sync(datum, w.find('table'), function(row) {
    return widget('semantics/grid_row', row);
});


// Pop up a new_row widget
w.find('.new_row').click(function() {
    w.append(
        widget('core:modal', {
            content: widget('semantics/new_row', relation, { context: context })
        })
    );
});

.{{= name }} {
    position: relative;
    padding: 0.5rem;
    color: #333;
    background-color: #888;
    text-overflow: ellipsis;
    overflow: hidden;
}

.{{= name }} {
    border-top: 1px solid #333;
}

.{{= name }}:hover {
    background-color: #666;
}

.{{= name }}:active {
    top: 1px;
    background-color: lightyellow !important;
}

.{{= name }}.selected {
    background-color: #333;
    color: #aaa;
}

var w = $("#"+id);


row.relation.row(row.pk_column_name, row.pk_value)
.then(function(row) {
    var rel_name = row.relation.schema.name + '.' + row.relation.name;

    row.columns.forEach(function(col) {
        w.append(
            '<tr>' +
            	'<td>' + 
		            widget('semantics/form_label', row.field(col.name)) + 
        	    '</td>' +
            	'<td>' + 
		            widget('semantics/form_field', row.field(col.name)) + 
	            '</td>' +
            '</tr>');
    });


    w.find('.delete_row').on('click', function() {
        if (confirm('Are you sure you\'d like to delete this row?')) {
            row.delete()
            .then(function() {
                w.trigger('status', ['Row deleted from ' + rel_name, 'success']);
                w.trigger('row_detail_delete');
                w.trigger('done');
                w.trigger('close_tab_self');
                w.remove();
            })
            .catch(function() {
                w.trigger('status', ['Failed delete on ' + rel_name, 'fail']);
            });
        }
    });

    w.find('.save_row').on('click', function() {
        row.update()
        .then(function() {
            return;
        })
        .catch(function() {
            alert('failed to save '+rel_name);
        });
    });

});

