var w = $("#"+id);

var rel_name = datum.schema.name + '.' + datum.name;
w.find('.rel_name').text(rel_name);

context = typeof context != 'undefined' ? context : {};


// look up this row's columns
endpoint.schema('meta').table('column').rows({
    where: [{
        name: 'relation_id',
        op: '=',
        value: datum.id
    }, {
        name: 'primary_key',
        op: '=',
        value: false
    }],
    include: ['id', 'name']
})
.then(function(columns) {

    if (!columns.length) {
        w.text('Inserting defaults...');
        return setTimeout(insert, 2000);
    }
    widget.sync(columns, w, function(c) {
        if (Object.keys(context).indexOf(c.get('name')) == -1) {
            return widget('semantics/new_field', datum.column(c.get('name')));
        }
    });
});


w.find('.save_row').on('click', save);
w.on('save', save);

function save(e) {
    console.log('saving....');
    e.stopPropagation();

    var new_fields = w.find('.new_field');
    var args = {};
    var invalid;

    for (var i = 0, f; i < new_fields.length; i++) {
        f = $(new_fields[i]);
        console.log(f.data('valid'), f.data('name'), f.data('value'));

        if (!f.data('valid')) {
            f.addClass('invalid');
            invalid = true;
        }
        if (typeof f.data('value') == 'undefined') {
            continue;
        }
        args[f.data('name')] = f.data('value');
    }

    if (!invalid) {
        insert(args);
    } else {
        w.trigger('status', 'Invalid values...');
    }
}

function insert(args) {

    args = Object.assign(args || {}, context);

    datum.insert(args)
    .then(function() {
        w.trigger('status', 'New row on ' + rel_name);
        w.trigger('done');
    }).catch(function() {
        w.trigger('status', 'Failed insert on ' + rel_name);
    });
}

var w = $('#'+id);
w.data('field', field);

var original_value = field.value;
w.data('revert_field', function() {
    field.value = original_value;
    return field;
});

// defaults to display and both modes available
var mode = starting_mode;
var display_available = (available_modes == 'both' || available_modes == 'display');
var edit_available = (available_modes == 'both' || available_modes == 'edit');

// defaults
if (typeof label_widget == 'undefined' || label_widget == false) {
    label_widget = 'sem_form_field_label';
}
if (typeof display_widget == 'undefined' || display_widget == false) {
    display_widget = 'field_display';
}
if (typeof edit_widget == 'undefined' || edit_widget == false) {
    edit_widget = 'field_edit';
}


w.find('.label').html(widget(label_widget, { field: field, column_id: false }));


// starting mode
if (mode == 'display') {
    w.find('.field_container').html(widget(display_widget, { field: field }));
}
else if (mode == 'edit') {

    // if started in edit mode, focus the field and select text (if applicable)
    if (typeof focused != 'undefined') {
        w.find('.field_container').html(
            widget(edit_widget, { field: field, focused: focused })
        );
    }
    else {
        w.find('.field_container').html(
            widget(edit_widget, { field: field, focused: false })
        );
    }
}


w.on('display_clicked', function(e) {
    //console.log('display_clicked and display mode is ', mode == 'display' ? 'on' : 'off');
    e.stopPropagation();
    if (mode == 'display' && edit_available) {
        w.find('.field_container').html(widget(edit_widget, { field: field }));
        mode = 'edit';
    }
});

w.on('field_changed', function(e) {
    //console.log('field changed and display mode is ', mode == 'display' ? 'on' : 'off');
    e.stopPropagation();
    if (mode == 'edit' && display_available) {
        w.find('.field_container').html(widget(display_widget, { field: field }));
        mode = 'display';
    }
});

var w = $('#'+id);

function display() {
    var val = field.value;

    if (val == null) {
        val = 'NULL';
    }

    else if (val == '') {
        val = '____';
    }

    w.find('.display').html(val);
    w.find('input').val(val);

    w.removeClass('saving')
    .removeClass('editing')
    .addClass('displaying');

    //w.find('.edit input').prop('disabled', false);
}
display();

function edit() {
    w.removeClass('displaying')
    .removeClass('saving')
    .addClass('editing');
    w.find('input').focus();
}


function save(saving_as_null) {

    w.removeClass('displaying')
    .removeClass('editing')
    .addClass('saving');

    //w.find('.edit input').prop('disabled', true);

    var old_value = field.value;

    // save
    if (saving_as_null) {
        field.set(null);
    }
    else {
        field.set(w.find('input').val());
    }

    field.update().then(function() {
        w.trigger('status', ['Saved', 'success']);
        w.trigger('form_field_save');
        display();

    }).catch(function(error) {
        field.set(old_value);
        w.trigger('status', ['Failed save', 'fail']);
        display();
    });
}


// EVENT BINDINGS
w.find('.save').on('click', save.bind(this, false));
w.find('.save_as_null').on('click', save.bind(this, true));
w.find('.display').on('click', edit);
w.find('.cancel').on('click', display);
w.find('input').on('keyup', function(e) {
    if (e.keyCode == 27) {
        display();
    }
    if (e.keyCode == 13) {
        save(false);
    }
});

