    }).catch(function() {
        w.trigger('status', ['Failed delete on ' + rel_name, 'fail']);
    });
});

var w = $("#"+id);


var fields = row.fields();
var show_fields = fields;



if (typeof field_visibility != 'undefined') {

    if (typeof field_visibility.include_fields != 'undefined') {

        show_fields = $.grep(fields, function(el, i) {

            // if element is in included fields
            return (field_visibility.include_fields.indexOf(el.name) > -1);

        });
    }


    else if (typeof field_visibility.exclude_fields != 'undefined') {

        show_fields = $.grep(fields, function(el, i) {

            // if element is not in excluded fields
            return (field_visibility.exclude_fields.indexOf(el.name) == -1);

        });
    }

}


for (var i = 0; i < show_fields.length; ++i) {
    w.append(widget('field_label', { field: show_fields[i] }));
}

